import React from "react";
import './CandidateList.css'
import CandidateItem from "./CandidateItem";

const CandidateList = ({posts}) =>{

    return(
        <div className='application-active'>
        {posts.map((post) => (
          <CandidateItem
            key={post.id}
            id={post.id}
            candidates={post.candidates}
          />
        ))}

    </div>
    )
}

export default CandidateList
